CREATE TABLE `bueditor_editors` (
  `eid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Primary Key: Unique editor ID.',
  `name` varchar(255) NOT NULL DEFAULT 'Noname' COMMENT 'The editor name.',
  `pages` text NOT NULL COMMENT 'Drupal paths on which the editor is visible.',
  `excludes` text NOT NULL COMMENT 'Textarea ids for which the editor is not visible.',
  `iconpath` varchar(255) NOT NULL DEFAULT '%BUEDITOR/icons' COMMENT 'The directory path where the editor icons reside.',
  `librarypath` text NOT NULL COMMENT 'Files to be included with the editor.',
  `spriteon` tinyint(4) NOT NULL DEFAULT '0' COMMENT 'The state of CSS sprite support.',
  `spritename` varchar(255) NOT NULL DEFAULT '' COMMENT 'The CSS sprite name under bueditor-sprites directory.',
  PRIMARY KEY (`eid`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='Stores editors and their settings.';
